{'longTextContent': 'OPPO Find X2系列发布会将于3月6日17:00举行。这里对已有信息进行汇总。

OPPO Find X2拥有两个版本。其中OPPO Find X2 Pro将采用6.7英寸2K+分辨率的OLED屏幕，左上角小挖孔屏。支持2K 120Hz刷新率。骁龙865，前置3200万像素，后置定制IMX689主摄，4800万像素+4800万像素+1300万像素。配备潜望式摄像头，主摄与长焦镜头支持OIS光学防抖（快板警告？）。4260毫安时电池，65W快充，或支持30W无线快充。配备双扬声器，X轴线性马达，IP68防水防尘。

OPPO Watch配备1.91英寸双曲面屏幕，326PPI（与Apple Watch同等级PPI）。100% DCI-P3广色域。支持心率检测，支持通话。或运行基于WearOS的定制化系统。', 'url_objects': []}

