like_summary:
{'longTextContent': '估计是很多人不知道……vivo 的手机在开机时是真的可以直接登录 Apple ID 的，目的是使用自带的互传服务登录 iCloud 账号，将照片和通讯录导入进来。互传的界面上也有「iPhone换机」的入口。

所以，有很多东西超出你的日常认知，但没有用过就真的不知道，不代表它没有。

（防杠补丁：为什么要用手机拍屏幕，因为第二个 iCloud 登录的界面不允许截屏）', 'url_objects': []}
